// App.js

import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import ChatApp from './ChatApp';
import StompHookProps, { STOMP_HOOK_PROPS_PATH } from './StompHookProps';

const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" component={ChatApp} />
        <Route path={STOMP_HOOK_PROPS_PATH} component={StompHookProps} />
      </Switch>
    </BrowserRouter>
  );
};

export default App;
